import React, { useEffect, useState } from 'react';
import { datadogRum } from '@datadog/browser-rum';
import axios from 'axios';

const MyComponent = ({prop}) => {


  useEffect(()=>{
        datadogRum.init({
          applicationId: '73a18c91-4533-48c1-9669-34c324c7220f',
          clientToken: 'pub8fe5f0c9085e4fb05db7a25cb714bad3',
          // `site` refers to the Datadog site parameter of your organization
          // see https://docs.datadoghq.com/getting_started/site/
          site: 'us5.datadoghq.com',
          service: 'newproject',
          env: 'NewProject',
          // Specify a version number to identify the deployed version of your application in Datadog
          version: '1.0.0', 
          sessionSampleRate: 100,
          sessionReplaySampleRate: 100,
          trackUserInteractions: true,
          trackResources: true,
          trackLongTasks: true,
          defaultPrivacyLevel: 'mask-user-input',
});
  },[])

    function onclick (){
      // datadogRum.setGlobalContext('username','Ajith')
      // datadogRum.setGlobalContext(prop)
      // console.log(prop);
      datadogRum.addAction('Submitted')
      console.log("Submitted");
    }

    let [data,setData] = useState({
      "Message": "","Name":" ","Query":" ","Type":" "
    })

    let{Message,Name,Query,Type} = data;

    let onchange=(e)=>{
      let {name,value} = e.target;
      setData()
    }

  return (
    <div>
      <button onClick={onclick}>Submit</button>

      <div>
        <form action="">
          <label>Message</label>
          <input type="text" name='Message' value={Message} onChange={onchange}/>
          <label>Text</label>
          <input type="text" name="Name" value={Name} />
          <label>Query</label>
          <input type="text" name='Query' value={Query} />
          <label>Type</label>
          <input type="text" name='Type' value={Type} />
        </form>
      </div>
    </div>
  );
};

export default MyComponent;
